import React, { useState, useEffect } from "react";

export default function Meal({ meal }) {
  const [imageUrl, setImageUrl] = useState("");

  return (
    <article>
      <h1>{meal.title}</h1>
      <image src={imageUrl} alt="recipe" />

      <ul>
        <li>Preparation time: {meal.readyInMinutes} minutes</li>
      </ul>
    </article>
  );
}
